class Solution:
    # My solution
    def threeSum(self, nums: list[int]) -> list[list[int]]:
        nums.sort(reverse=False)
        
        tmp_set = set()
        
        def twoSum(arr: list[int], third_int: int, target=0):
            start = 0
            end = len(arr) - 1
            
            while start < end:
                
                curr = arr[start] + arr[end] + third_int
                
                if curr == target:
                    if (arr[start], arr[end], third_int) not in tmp_set and (arr[end],arr[start],third_int) not in tmp_set and (third_int, arr[start], arr[end]) not in tmp_set:
                        tmp_set.add((arr[start], arr[end], third_int))
                    start += 1
                    
                elif curr > target:
                    end -= 1
                else:
                    start += 1
    
            
        for i in range(len(nums)):
            twoSum(nums[i + 1:], nums[i])
        
        return [list(x) for x in tmp_set]
    
    def threeSum(self, nums: list[int]) -> list[list[int]]:

        nums.sort()
        result = []
        
        for i in range(len(nums) - 2):
            if i > 0 and nums[i] == nums[i - 1]:
                continue
            
            target = -nums[i]
            left, right = i + 1, len(nums) - 1
            
            while left < right:
                total = nums[left] + nums[right]
                if total == target:
                    result.append([nums[i], nums[left], nums[right]])
                    
                    while left < right and nums[left] == nums[left + 1]:
                        left += 1
                    while left < right and nums[right] == nums[right - 1]:
                        right -= 1
                    left += 1
                    right -= 1
                elif total < target:
                    left += 1
                else:
                    right -= 1
        
        return result

 

s = Solution()
assert s.threeSum([-2,0,1,1,2]) == [[-2,0,2],[-2,1,1]]
assert s.threeSum([-1,0,1,2,-1,-4]) == [[-1,-1,2],[-1,0,1]]
assert s.threeSum([0,1,1]) == []
assert s.threeSum([0,0,0]) == [[0,0,0]]
